import React from 'react';
import CartItem from './CartItem';

function Cart() {
  const cartItems = [
    { id: 1, name: 'Product 1', price: 9.99, quantity: 2 },
    { id: 2, name: 'Product 2', price: 14.99, quantity: 1 },
  ];

  return (
    <div className="cart">
      <h2>Cart</h2>
      {cartItems.map((item) => (
        <CartItem key={item.id} {...item} />
      ))}
    </div>
  );
}

export default Cart;
